import React, { useEffect, useState } from "react";

const Profile = () => {
  const [User, setUser] = useState({
    name: "",
    email: "",
    pass: "",
    uname: "",
  });
  useEffect(() => {
    if (sessionStorage.getItem("users") != null) {
      const loguser = sessionStorage.getItem("users");
      const username = JSON.parse(loguser);
      setUser(username);
    }
  },[]);
  return (
    <>
      <div className="UserPic text-center mt-5">
        <img className="pic" src="default.png" alt="userpic"></img>
      </div>
      <div className="d-flex justify-content-center">
        <div className="col-md-11 mt-5 pt-3">
          <table class="table table-striped bg-white table-hover table-bordered shadow-lg">
            <tbody>
              <tr>
                <th scope="row">Name</th>
                <td>{User.name}</td>
                <td>EDIT</td>
              </tr>
              <tr>
                <th scope="row">User Name</th>
                <td>{User.uname}</td>
                <td>EDIT</td>
              </tr>
              <tr>
                <th scope="row">Email</th>
                <td>{User.email}</td>
                <td>EDIT</td>
              </tr>
              <tr>
                <th scope="row">Password</th>
                <td>{User.pass}</td>
                <td className="text-center"><i className="fa fa-edit" style={{"font-size":"1.2rem","color":"red"}}></i></td>
              </tr>
            </tbody>
          </table>
        </div>
      </div>
    </>
  );
};

export default Profile;
